import React from "react";
import "./Columns.css";
import "../AddItem/AddItem";

function Columns() {
  return (
    <div className="columns-container">
      <div className="column">
        <h2>Column 1</h2>
        <AddItem />
      </div>
      <div className="column">
        <h2>Column 2</h2>
        <AddItem />
      </div>
      <div className="column">
        <h2>Column 3</h2>
        <AddItem />
      </div>
      <div className="column">
        <h2>Column 4</h2>
        <AddItem />
      </div>
    </div>
  );
}

export default Columns;
